       NEW.LOW_ANALYST_PRICE_TARGET <> OLD.LOW_ANALYST_PRICE_TARGET OR
       NEW.HIGH_ANALYST_PRICE_TARGET <> OLD.HIGH_ANALYST_PRICE_TARGET
